import React, { useEffect } from 'react';
import 'materialize-css/dist/css/materialize.min.css';
import M from 'materialize-css/dist/js/materialize.min.js';
import './App.css';

const App = () => {
	// initializes materialize javascript for modals
	useEffect(() => {
		M.AutoInit();
	});

	return (
		<div className='Apple'>
			<h1>My app</h1>
		</div>
	);
};

export default App;
